import React, { useEffect, useState } from "react";
import "./News.css";
const News = () => {
    const [save, setSave] = useState(null);
    useEffect(() => {
        const fetchData = async () => {
            const response = await axios.get("url");
            setSave(response);
        };
        fetchData;
    });
    return <div className="news">news</div>;
};

export default News;
